import styled from "styled-components";

export const HeaderStyled = styled.div`
    .ant-table-thead .ant-table-cell {
        background-color: #373e58;
        color: #fff;
    }
`;

export const ImageMaskCircle = styled.div`
    .ant-image-mask {
        border-radius: 50%;
    }
`;
